import "./styles.css";
import React from 'react';
import { Loader } from '@googlemaps/js-api-loader';


class App extends React.Component {
    render() {
        return <div className="App">
            <div id="mapContainer"><Map /></div>
            <Search />
        </div>;
    }
}

class Map extends React.Component {
    constructor(props) {
        super(props);
    }

    loader = new Loader({
        apiKey: "AIzaSyD8Vp_eqij2KVTiHCTi9mQgKaGCAZ5FRDQ",
        version: "weekly",
        libraries: ["places"]
    });

    mapOptions = {
        center: {
            lat: -25.344, lng: 131.031
        },
        disableDefaultUI: true,
        draggable: true,
        mapTypeId: 'terrain',
        zoom: 4
    };

    render() {
        return (<div id="map"></div>);
    }


    componentDidMount() {
        this.loader
            .load()
            .then((google) => {
                new google.maps.Map(document.getElementById("map"), this.mapOptions);
            })
            .catch(e => {
                // do something
            });
    }
}

class Search extends React.Component {
    constructor(props) {
        super(props);
        //this.SearchBar.keyUpHandler
    }

    render() {
        return <div className="searchContainer">
            <SearchBar />
            <SearchResultsList />
        </div>;
    }

    fetchGeoLocation = (q) => {
        fetch(`http://api.openweathermap.org/geo/1.0/direct?q=${q}&limit=5&appid=f4bcb6a805ca765f7df85383dc7fdbab`)
            .then(res => re.json())
            .then(data => {
                console.log(data);
            })
            .catch(e => console.error(e));
    }
}

class SearchBar extends React.Component {
    constructor(props) {
        super(props);
    }

    keyUpHandler = (e) => {
        console.log(e);
    }

    render() {
        return <div className="searchBar">
            <input className="search" placeholder="Search Location..." onKeyUp={this.keyUpHandler.bind(this)} />
        </div>;
    }
}

class SearchResultsList extends React.Component {
    constructor(props) {
        super(props);
    }

    results = ["Hello", "World", "What's up?"];

    renderResults() {
        return this.results.map(x => <div>{x}</div>);
    }

    render() {
        return <div className="searchResults">
            {this.results.map((result, key) => <SearchResult key={key} result={result} />)}
        </div>;
    }
}

class SearchResult extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return <div>{this.props.result}</div>;
    }
}

export default App;
